sys_variable_value.value:
(function execute(inputs, outputs) {
   var description = inputs.description;
   var shortDescription = inputs.shortDescription;
   var alertGR = inputs.alertGR;
   var alertAddInfo = alertGR.getValue('additional_info');
    shortDescription.split(/[${}]/).forEach(function(item) {
        var placeholder = '${' + item + '}';
        //gs.info(item);
        if(/^additional_info\./.test(item)){
            var parser = JSON.parse(alertAddInfo);
            var details = item.replace('additional_info.', '');
            if(details.indexOf('.') == -1){
                var additionalInfo = parser[details];
                if (additionalInfo) {
                shortDescription = shortDescription.replace(placeholder, additionalInfo);
            }
            }else{
                var nested = details.split('.');
                 var additionalInfo = parser[nested[0]];
                 gs.info(additionalInfo);
                   if (additionalInfo) {
                shortDescription = shortDescription.replace(placeholder, additionalInfo[nested[1]]);
            }
            }
        }else if (item && shortDescription.includes(placeholder)) {
            var element = alertGR.getElement(item);
            if (element) {
                shortDescription = shortDescription.replace(placeholder, element.getDisplayValue());
            }
        }
    });
outputs['short_description'] = shortDescription;

    description.split(/[${}]/).forEach(function(item) {
        var placeholder = '${' + item + '}';
        //gs.info(item);
        if(/^additional_info\./.test(item)){
            var parser = JSON.parse(alertAddInfo);
            var details = item.replace('additional_info.', '');
            if(details.indexOf('.') == -1){
                var additionalInfo = parser[details];
                if (additionalInfo) {
                description = description.replace(placeholder, additionalInfo);
            }
            }else{
                var nested = details.split('.');
                 var additionalInfo = parser[nested[0]];
                 gs.info(additionalInfo);
                   if (additionalInfo) {
                description = description.replace(placeholder, additionalInfo[nested[1]]);
            }
            }
        }else if (item && description.includes(placeholder)) {
            var element = alertGR.getElement(item);
            if (element) {
                description = description.replace(placeholder, element.getDisplayValue());
            }
        }
    });
outputs['description'] = description;

})(inputs, outputs);

